
class BTreeNode:
    def __init__(self, data):
        self.data = data
        self.left = None
        self.right = None


    def insert_child(self, l_or_r, node):
        if l_or_r == 0:
            if self.left != None:
                return False
            self.left = node
        elif l_or_r == 1:
            if self.right != None:
                return False
            self.right = node
        else:
            return False
        return True
    
def build_binary_tree(input_str):
    if not input_str:
        return None
    values = input_str.split(",")
    root = BTreeNode(int(values[0]))
    for i in range(1, len(values) - 1):
        insert_by_value(root, int(values[i]))
    return root

def insert_by_value(node, data):
    if data >= node.data:
        if node.right == None:
            node.right = BTreeNode(data)
        else:
            insert_by_value(node.right, data)
    else:
        if node.left == None:
            node.left = BTreeNode(data)
        else:
            insert_by_value(node.left, data)

